-- Unit test for [sqids].[Encode].
-- The test passes when all rows have a 1 in the Is Match column.

DECLARE @tests TABLE (Number INT, Id NVARCHAR(MAX))

SELECT Number, CASE WHEN Id = [sqids].[Encode](Number, 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789', 255) THEN 1 ELSE 0 END [Is Match]
FROM @tests